\u0434\u0438\u044f\">\u0411\u0440\u0438\u0442\u0430\u043d\u0441\u043a\u043e\u0439 \u0418\u043d\u0434\u0438\u0438<\/a>, \u043f\u0440\u043e\u043f\u0430\u043b\u043e \u0431\u043b\u0438\u0437 \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%B4%D0%B6%D0%B0%D1%80%D0%B0%D1%82\" title=\"\u0413\u0443\u0434\u0436\u0430\u0440\u0430\u0442\">\u0413\u0443\u0434\u0436\u0430\u0440\u0430\u0442\u0430<\/a>; \u043f\u043e\u0433\u0438\u0431\u043b\u043e 746 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c<\/a> \u0448\u0442\u0430\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BB%D0%BE%D1%80%D0%B0%D0%B4%D0%BE\" title=\"\u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e\">\u041a\u043e\u043b\u043e\u0440\u0430\u0434\u043e<\/a> \u0436\u0435\u043d\u0449\u0438\u043d\u044b \u043f\u043e\u043b\u0443\u0447\u0438\u043b\u0438 \u043f\u0440\u0430\u0432\u043e \u0443\u0447\u0430\u0441\u0442\u0432\u043e\u0432\u0430\u0442\u044c \u0432 \u0432\u044b\u0431\u043e\u0440\u0430\u0445.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1895_%D0%B3%D0%BE%D0%B4\" title=\"1895 \u0433\u043e\u0434\">1895<\/a>&#160;\u2014 \u0432 \u043f\u0440\u043e\u0446\u0435\u0441\u0441\u0435 \u044d\u043a\u0441\u043f\u0435\u0440\u0438\u043c\u0435\u043d\u0442\u043e\u0432 \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%B5%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u0442\u0432\u043e\">\u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u0442\u0432\u043e\u043c<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BD%D1%82%D0%B3%D0%B5%D0%BD,_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC_%D0%9A%D0%BE%D0%BD%D1%80%D0%B0%D0%B4\" title=\"\u0420\u0435\u043d\u0442\u0433\u0435\u043d, \u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u041a\u043e\u043d\u0440\u0430\u0434\">\u0412\u0438\u043b\u044c\u0433\u0435\u043b\u044c\u043c \u0420\u0435\u043d\u0442\u0433\u0435\u043d<\/a> \u043e\u0442\u043a\u0440\u044b\u043b \u0438\u0437\u043b\u0443\u0447\u0435\u043d\u0438\u0435, \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u043e\u0435 \u0438\u043c X-\u043b\u0443\u0447\u0430\u043c\u0438, \u0432\u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u0438 \u0432 \u0447\u0435\u0441\u0442\u044c \u0443\u0447\u0451\u043d\u043e\u0433\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u043d\u043e\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%BD%D1%82%D0%B3%D0%B5%D0%BD%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B5_%D0%B8%D0%B7%D0%BB%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D0%B5\" title=\"\u0420\u0435\u043d\u0442\u0433\u0435\u043d\u043e\u0432\u0441\u043a\u043e\u0435 \u0438\u0437\u043b\u0443\u0447\u0435\u043d\u0438\u0435\">\u0440\u0435\u043d\u0442\u0433\u0435\u043d\u043e\u0432\u0441\u043a\u0438\u043c<\/a>.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1903_%D0%B3%D0%BE%D0%B4\" title=\"1903 \u0433\u043e\u0434\">1903<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%B4%D0%B5%D1%80%D0%BB%D0%B0%D0%BD%D0%B4%D1%8B\" title=\"\u041d\u0438\u0434\u0435\u0440\u043b\u0430\u043d\u0434\u044b\">\u0413\u043e\u043b\u043b\u0430\u043d\u0434\u0438\u0438<\/a> \u0441\u043e\u043e\u0431\u0449\u0430\u0435\u0442\u0441\u044f \u043e\u0431 \u0438\u0437\u043e\u0431\u0440\u0435\u0442\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%BA%D0%B0%D1%80%D0%B4%D0%B8%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%8F\" title=\"\u042d\u043b\u0435\u043a\u0442\u0440\u043e\u043a\u0430\u0440\u0434\u0438\u043e\u0433\u0440\u0430\u0444\u0438\u044f\">\u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043a\u0430\u0440\u0434\u0438\u043e\u0433\u0440\u0430\u0444\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%BA%D1%82%D1%8F%D0%B1%D1%80%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u041e\u043a\u0442\u044f\u0431\u0440\u044c\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u043d\u0430\u0447\u0430\u043b\u043e \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u0438 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438<\/a> (26 \u043e\u043a\u0442\u044f\u0431\u0440\u044f \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%BB%D0%B8%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%B0%D0%BB%D0%B5%D0%BD%D0%B4%D0%B0%D1%80%D1%8C\" title=\"\u042e\u043b\u0438\u0430\u043d\u0441\u043a\u0438\u0439 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044c\">\u042e\u043b\u0438\u0430\u043d\u0441\u043a\u043e\u043c\u0443 \u043a\u0430\u043b\u0435\u043d\u0434\u0430\u0440\u044e<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432 \u0442\u043e \u0432\u0440\u0435\u043c\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0430 \u0420\u043e\u0441\u0441\u0438\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1923_%D0%B3%D0%BE%D0%B4\" title=\"1923 \u0433\u043e\u0434\">1923<\/a>&#160;\u2014 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%B2%D0%BD%D0%BE%D0%B9_%D0%BF%D1%83%D1%82%D1%87\" title=\"\u041f\u0438\u0432\u043d\u043e\u0439 \u043f\u0443\u0442\u0447\">\u041f\u0438\u0432\u043d\u043e\u0439 \u043f\u0443\u0442\u0447<\/a>\u00bb \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%8E%D0%BD%D1%85%D0%B5%D0%BD\" title=\"\u041c\u044e\u043d\u0445\u0435\u043d\">\u041c\u044e\u043d\u0445\u0435\u043d\u0435<\/a>: \u043f\u043e\u043f\u044b\u0442\u043a\u0430 \u0437\u0430\u0445\u0432\u0430\u0442\u0430 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u043b\u0430\u0441\u0442\u0438, \u043f\u0440\u0435\u0434\u043f\u0440\u0438\u043d\u044f\u0442\u0430\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB-%D1%81%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BD%D0%B5%D0%BC%D0%B5%D1%86%D0%BA%D0%B0%D1%8F_%D1%80%D0%B0%D0%B1%D0%BE%D1%87%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F\" title=\"\u041d\u0430\u0446\u0438\u043e\u043d\u0430\u043b-\u0441\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043d\u0435\u043c\u0435\u0446\u043a\u0430\u044f \u0440\u0430\u0431\u043e\u0447\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f\">\u041d\u0421\u0414\u0410\u041f<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1943_%D0%B3%D0%BE%D0%B4\" title=\"1943 \u0433\u043e\u0434\">1943<\/a>:<ul><li>\u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%D0%A1%D0%BB%D0%B0%D0%B2%D1%8B\" title=\"\u041e\u0440\u0434\u0435\u043d \u0421\u043b\u0430\u0432\u044b\">\u041e\u0440\u0434\u0435\u043d \u0421\u043b\u0430\u0432\u044b<\/a>&#160;\u2014 \u0432\u043e\u0435\u043d\u043d\u044b\u0439 \u043e\u0440\u0434\u0435\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>.<\/li><li>\u0443\u0447\u0440\u0435\u0436\u0434\u0451\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D1%80%D0%B4%D0%B5%D0%BD_%C2%AB%D0%9F%D0%BE%D0%B1%D0%B5%D0%B4%D0%B0%C2%BB\" title=\"\u041e\u0440\u0434\u0435\u043d \u00ab\u041f\u043e\u0431\u0435\u0434\u0430\u00bb\">\u041e\u0440\u0434\u0435\u043d \u00ab\u041f\u043e\u0431\u0435\u0434\u0430\u00bb<\/a>&#160;\u2014 \u0432\u044b\u0441\u0448\u0438\u0439 \u0432\u04